import numpy as np
from analyze import *

#create response graph
#nodes are responses
#edges are relatedness based on features
    #summed difference between feature scores, weighted by coming-to-mindness?

#animals we have data for
#a = get_animals()
#animals = []
animals = get_animals()
#for i in range(20):
#    animals.append(a[i])

#ratings gives each animals score for each feature
data, ratings = create_dict()
#generation count for each animal
genCounts, genList = generations()
#probability of animal generation (percent of all responses)
probs = genProbs(genCounts)
#correlation between descriptors' scores for each animal and that animal's coming to mind
corrs = genDescriptorCorrelation(probs, ratings)

resMap = {}
m = 0
#for each animal, make list of all other animals, and 
for a in animals:
    resMap[a] = {}
    for a2 in animals:
        #summed difference of the two animals between ratings for each descriptor, weighted by correlation of descriptor with coming-to-mindness
        resMap[a][a2] = sum([(abs(ratings[d][a] - ratings[d][a2]) * corrs[d]) for d in ratings.keys()])
        m = max(m, resMap[a][a2])
print(resMap)

